    const navigate = useNavigate()
    const {state} = useLocation()
    const client = state.client



    const onClickFood = async(e) => {
        e.preventDefault()
        navigate('/client/restaurants', {
            state: {
                client : client
            }
        })
    }
       

    const onClickViewOrders = async(e) => {
        e.preventDefault()
        navigate('/client/orders', {
            state: {
                client : client
            }
        })
    }

    const onLogOutSubmit = (e) => {
        e.preventDefault()

        navigate('/', {
        })
    }

    const onClickViewCart = (e) => {
        e.preventDefault()

        navigate('/', {
        })
    }

    return(
        <div>
        <div className = "row">
        <div style={{color: '#800040', marginLeft : 50, fontSize : 50}}>FoodPanda</div>
        <button className = "btn" style = {{marginLeft : 900}} type="submit" id='btn-log-out' onClick={(e) => onClickViewCart(e)}>
            View Cart
        </button>
        <button className = "btn" style = {{marginLeft : 20}} type="submit" id='btn-log-out' onClick={(e) => onLogOutSubmit(e)}>
            Log out
        </button>
        </div>
        <hr></hr>

        
        <div className='containerWithBorder centerContainer'>
                <button  onClick={(e) => onClickFood(e)} 
                class="btn btn-primary btn-block firstButton" type="submit">
                    I want food</button>
                <button onClick={(e) => onClickViewOrders(e)} 
                class="btn btn-primary btn-block" type="submit">
                    My Orders</button>
        
        </div>
        </div>
    
        )
}

export default ClientInitialView
